const Footer = () => {
  const githubLogo = (
    <img
      src="https://github.githubassets.com/images/modules/logos_page/GitHub-Mark.png"
      alt="github.com logo"
    />
  );

  return (
    <div className="footer">
      <p>Copyright by Mihai Gabriel</p>
      {githubLogo}
    </div>
  );
};

export default Footer;
